struct Date_input{
    std::array<Date_input_field,10> input_field;
    std::string name="Объект";
    void write_file(std::string name_file){
        std::ofstream out(name_file, std::ios::app);
        out<<"["<<name<<"]"<<std::endl;
        out.close();
        for(auto &T:input_field){
            T.write_file(name_file);
        }
        }
    Date_input_field  & operator[](int i){
        return input_field[i];
    }
    };



