void read_values(std::string name,std::array<Date_input,25> & T){
   std::string line="";
   std::ifstream in(name);
   for(int i=0;i<25;i++){
        (getline(in, line));
        for(int j=0;j<10;j++){
            if(T[i][j].on_imput){
                (getline(in, line));
                int k=line.find('=');
                std::string lll="";
                    for(int p=k+1;p<line.size();p++){
                          lll+=line[p];
                      }
                T[i][j].current_value_symbol=lll;
                std::cout<<lll<<"|||"<<i<<"||"<<T[i][j].current_value_symbol<<std::endl;
            }
      }
   }
};



